        return new Twig_Source("<link rel=\"stylesheet\" href=\"{{ asset('asset/css/main.css') }}\">
{% block content %}


<div class=\"forming\">

{% if app.request.hasPreviousSession %}
    {% for type, messages in app.session.flashbag.all() %}
        {% for message in messages %}
            <div class=\"flash-{{ type }}\">
                {{ message }}
            </div>
        {% endfor %}
    {% endfor %}
{% endif %}

<div>
